import { produceWithPatches } from "immer";
import React, { useState } from "react";
import { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import Loading from "../Components/Loading";
import classes from "./Products.module.css";

function Posts() {
  const navigate = useNavigate();
  const [loading, setloading] = useState(true);
  const [showProducts, setshowProducts] = useState(false);
  const [productList, setproductList] = useState([]);
  useEffect(() => {
    const token = localStorage.getItem("token");
    fetch("http://localhost:8080/products", {
      headers: {
        Authorization: "Bearer " + token,
      },
    })
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        console.log(data);
        if (data.message === "Product list") {
          console.log(data.products);
          setproductList(data.products);
          setloading(false);
          setshowProducts(true);
        } else {
          navigate("/auth");
        }
      });
  }, []);
  return (
    <>
      <div class="container px-4" style="margin-top: 10px;">
        <div class="row gy-5 gx-5">
          {productList.map((card) => (
            <div class="col-md-6 col-lg-4">
              <div class="myclassbody">
                <div
                  class="card mb-3 justify-content-md-center mycard"
                  style={{ "max-width": "500px" }}
                >
                  <div class="row g-0">
                    <div class="col-md-4 col-lg-6">
                      <img
                        src=""
                        class="myimage img-fluid rounded-start"
                        alt="..."
                      />
                    </div>
                    <div class="col-md-8 col-lg-6">
                      <div class="card-body">
                        <h5 class="card-title"></h5>
                        <p class="elip ">
                          This is a koala card with supporting text below as a
                          natural lead-in to additional content. This content is
                          a little bit longer.
                        </p>
                        <p class="card-text">Australia</p>
                        <div></div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
      {loading && <Loading />}
    </>
  );
}

export default Posts;
